  DFFR_E rst_n_syn_reg ( .D(out1), .CLK(clk), .RN(rst_n), .QBAR(n1) );
  INVERT_I U3 ( .A(n1), .Z(rst_n_syn) );
endmodule


module proj9_top_syn ( SCLK, MOSI, CSN, rst_n, MISO, MISO_enable );
